import React, { useState } from "react";
import Logo from "../../../images/Logo.jpg";
import { BsCart2 } from "react-icons/bs";
import UserCard from "./UserCard";

const UserName = ({ nombre, apellido }) => {
  const [visible, setVisible] = useState(false);
  return (
    <div className=" absolute top-5 w-full flex flex-wrap justify-between">
      <div className=" w-fit h-fit ml-12">
        <img
          src={Logo}
          alt="logo"
          style={{ width: "10%", objectFit: "contain" }}
        />
      </div>
      <div className=" flex justify-center items-center">
        {visible === false ? (
          <h1 className=" text-xl font-[Dosis]">Mi Bid Max</h1>
        ) : (
          <UserCard nombre={nombre} apellido={apellido} />
        )}
      </div>
      <div className=" flex w-fit">
        <BsCart2 size="50" className=" hover:cursor-pointer mr-12" />
      </div>
    </div>
  );
};

export default UserName;
